import React, {Component} from 'react';
import axios from 'axios';

class App extends Component{

  componentDidMount(){
    axios.get('/api/product/brands').then( response =>{
      console.log(response)
    }).catch( e=> console.log(e))
  }

  render(){
    return (
      <div className="App">
        My App
      </div>
    );
  }
}

export default App;
